import React from 'react';
import ReactDOM from 'react-dom';
import * as serviceWorker from '../serviceWorker';
import withConnect from '../components/withConnect';
import VideoTracking from '../components/video-tracking';
import { methods, samplePayload } from '../components/video-tracking/payload';
import { AnnotationType } from '../types';

const VideoTrackingComp: React.FC = withConnect({ type: AnnotationType.VIDEO_TRACK, methods, samplePayload })(VideoTracking);

ReactDOM.render(
  <VideoTrackingComp />,
  document.getElementById('root'),
);

serviceWorker.unregister();
